import TitleH1 from "./components/TitleH1";
import TitleH2 from "./components/TitleH2";
import Counter from "./components/Counter";
import List from "./components/List";
import './App.css';

function App() {
  return (
    <div className="App">
      <TitleH1 name="Amelie" age={26} />
      <TitleH2 />
      <Counter name="Compteur #1" />
      <List />
      <p>Bonjour Simplon</p>
    </div>
  );
}

export default App;
